import WHT from './assets/circle-white.png';
import BLK from './assets/circle-black.png';
import BLU from './assets/circle-blue.png';
import RED from './assets/circle-red.png';
import YLW from './assets/circle-yellow.png';
import ORN from './assets/circle-orange.png';
import GRN from './assets/circle-green.png';
import VLT from './assets/circle-violet.png';

import GRY from './assets/circle-grey.png';

function GameOutput(data) {

  const results = data.array.map( x => {  if (x === 'WHT' || x === 'M') return WHT;
                                          if (x === 'GRY' || x === 'F' ) return GRY;
                                          if (x === 'BLK' || x === 'H') return BLK;
                                          if (x === 'BLU') return BLU;
                                          if (x === 'RED') return RED;
                                          if (x === 'YLW') return YLW;
                                          if (x === 'ORN') return ORN;
                                          if (x === 'GRN') return GRN;
                                          if (x === 'VLT') return VLT;
                                          if (x === 'GRY' || x === 'F' ) return GRY;
                                })



  return (
        <div className='game-output'>
          <div className="ref-output">
            <span className='circle-input'><img   draggable="false" src={results[0]}    className='circle-controls-1 '/></span>
            <span className='circle-input'><img   draggable="false" src={results[1]}    className='circle-controls-1'/></span>
            <span className='circle-input'><img   draggable="false" src={results[2]}    className='circle-controls-1'/></span>
            <span className='circle-input'><img   draggable="false" src={results[3]}    className='circle-controls-1'/></span>
          </div>
          <div className="box-output">
            <span ><img  draggable="false" src={results[4]} className='circle-output'/></span>
            <span ><img  draggable="false" src={results[5]} className='circle-output'/></span>
            <span ><img  draggable="false" src={results[6]} className='circle-output'/></span>
            <span ><img  draggable="false" src={results[7]} className='circle-output'/></span>
          </div>
        </div>

  );

}




export default GameOutput;
